import React, { Component } from 'react';
import PropTypes from "prop-types";
import isEqual from "react-fast-compare";
import  ImageMapper from 'react-image-mapper';
import  MaleBody  from '/Users/Danny/Documents/student-portal2/src/images/MaleBody.jpg';
import Modal from '../modal/Modal';


class Body extends Component {
	constructor() {
        super();

        this.state = {
            isShowing: false
        }
    }

    openModalHandler = () => {
        this.setState({
            isShowing: true
        });
    }

    closeModalHandler = () => {
        this.setState({
            isShowing: false
        });
    }

    render() {

       let  MAP ={
            name: "my-map",
            areas: [
              { name: "5", shape: "circle", coords: [136, 181, 5 ], preFillColor: "blue"   },
            ]
          }
        return (


            <div className="container" >
	<ImageMapper src={MaleBody} map={MAP} width={610} height={435} 
	onClick={area => this.clicked(area)}
    />
	</div>
);
}
}


export default Body;
